export const Login = () => {


  return (
    <Box
      sx={{
        bgcolor: Theme.palette.secondary.light,
        boxShadow: 1,
        borderRadius: 5,
        p: 2,
        m: 3,
        "&:hover": {
          backgroundColor: Theme.palette.secondary.main,
        },
      }}
    >
    <TextField 
         label="email"
        variant="outlined"
         />
    <TextField 
         label="password"
        variant="outlined"
         />
               <SwitchButton text={'Register'} href={"/register"}/>

    </Box>
  );
};
